import { Box, Modal } from "@mui/material";

interface ModalBaseProps {
  open: boolean;
  onClose(): void;
}

const ModalBase = (
  { open, onClose }: ModalBaseProps,
  children: JSX.Element
): JSX.Element => {
  return (
    <Modal open={open} onClose={onClose}>
      <Box>{children}</Box>
    </Modal>
  );
};

export default ModalBase;
